function ImagePopup() {
  return (
    <div className="popup zoom-image" id="opn-img">
      <div className="popup__image-container popup__container">
        <button className="popup__close-button opacity" id="close-img-popup"></button>
        <img src="#" alt="#" className="popup__image"/>
        <p className="popup__title"></p>
      </div>
    </div>
  )
}

export default ImagePopup;
